import React, { Component } from "react";
import GenNavBar from "./navbar/GenNavBar";
import HeaderImages from "../images/header/HeaderImages";
import Grid from "@material-ui/core/Grid";
import HeaderContent from "./content/HeaderContent";
import "../../../../index.css";
import Paper from "@material-ui/core/Paper";
import Sign from "../../components/ui/Sign";

class HomePage extends Component {
  signInNav = () => {
    this.props.history.push("/signin");
  };

  signUpNav = () => {
    this.props.history.push("/signup");
  };

  render() {
    return (
      <div>
        <Grid
          container
          style={{
            background: "transparent",
          }}
        >
          <Grid item xs={12}>
            <GenNavBar
              signInNav={this.signInNav}
              signUpNav={this.signUpNav}
            ></GenNavBar>
          </Grid>
          <Grid
            item
            xs={12}
            style={{
              height: "57rem",
              background: "transparent",
              border: "1px soild red",
            }}
          >
            <HeaderContent signUpNav={this.signUpNav}></HeaderContent>
          </Grid>

          <Grid
            item
            xs={6}
            style={{
              paddingLeft: "2rem",
              paddingTop: "4rem",
              paddingRight: "2rem",
            }}
          >
            <h2
              style={{
                fontSize: "52px",
                fontFamily: "Manrope",
                color: "#2a6bf4",
              }}
            >
              Be cognizient about your money
            </h2>
            <h4
              style={{
                fontSize: "20px",
                fontFamily: "Manrope",
                fontWeight: 200,
              }}
            >
              Take definite steps now to make your goals pragmatic. My Portolio
              Home give you a diverse range of options to enter your inflow and
              outflow of your funds.
            </h4>
          </Grid>
          <Grid item xs={6} style={{ paddingLeft: "5rem" }}>
            <HeaderImages image={"1"}></HeaderImages>
          </Grid>
          <Grid item xs={6} style={{ paddingLeft: "5rem" }}>
            <HeaderImages image={"2"}></HeaderImages>
          </Grid>
          <Grid
            item
            xs={6}
            style={{
              paddingLeft: "2rem",
              paddingTop: "4rem",
              paddingRight: "2rem",
            }}
          >
            <h2
              style={{
                fontSize: "52px",
                fontFamily: "Manrope",
                color: "#2a6bf4",
              }}
            >
              Proactively set your life goals
            </h2>
            <h4
              style={{
                fontSize: "20px",
                fontFamily: "Manrope",
                fontWeight: 200,
              }}
            >
              Dreams thrive our lives. Don't let dreams go in vain wihtout
              proper planning and execution. We provide an opportunity for you
              to place your plan in action.
            </h4>
          </Grid>
          <Grid
            item
            xs={6}
            style={{
              paddingLeft: "2rem",
              paddingTop: "4rem",
              paddingRight: "2rem",
            }}
          >
            <h2
              style={{
                fontSize: "52px",
                fontFamily: "Manrope",
                color: "#2a6bf4",
              }}
            >
              Reports and Analytics
            </h2>
            <h4
              style={{
                fontSize: "20px",
                fontFamily: "Manrope",
                fontWeight: 200,
              }}
            >
              Comprehensive reports and analysis provides you path towards
              achieving your goals. You will be provided with wide variety
              investments options to link with yuor goals.
            </h4>
          </Grid>
          <Grid item xs={6} style={{ paddingLeft: "5rem" }}>
            <HeaderImages image={"3"}></HeaderImages>
          </Grid>
          <Grid item xs={12} style={{ padding: "2rem" }}></Grid>
          <Grid item xs={1}>
            <Paper
              style={{
                height: "20rem",
                background: "transparent",
                boxShadow: "none",
              }}
            ></Paper>
          </Grid>
          <Grid item xs={10}>
            <div
              style={{
                height: "25rem",
                borderRadius: "5rem",
                boxShadow: "none",
                background: "linear-gradient(to right , #86abf9, #6893ee)",
              }}
            >
              <div
                style={{
                  width: "100%",
                  height: "12rem",
                  border: "1px solid red",
                }}
              >
                <div
                  style={{
                    width: "25rem",
                    height: "12rem",
                    border: "1px solid yellow",
                  }}
                ></div>

                <div
                  style={{
                    width: "auto",
                    height: "12rem",
                    border: "1px solid blue",
                  }}
                ></div>
              </div>
              <div
                style={{
                  width: "100%",
                  height: "13rem",
                }}
              ></div>
            </div>
          </Grid>
          <Grid item xs={1}>
            <Paper
              style={{
                height: "20rem",
                background: "transparent",
                boxShadow: "none",
              }}
            ></Paper>
          </Grid>
          <Grid item xs={12} style={{ padding: "2rem" }}></Grid>
        </Grid>
      </div>
    );
  }
}

export default HomePage;
